import React from 'react';

export class ClientCaseCreation extends React.Component
{
    constructor(props) {
        super(props);
        /*
        this.data = fetch('http://52.247.220.137/manage_cases?a=1').then( resp => resp.json)
            .then(result => console.log(result));
        */
        this.state = {
            pat_email: '',
            pat_notes: '',  //Details that patients can add to case
            phy_email: '',
            phy_firstName: '',
            phy_lastName: '',
            phy_bio: '',
            phy_spec: '',
            phy_hospital: '',
            pics: '',    //Images of the patient for the case
            caseTitle: ''
        };

    }

    handleInputChange = (event) =>
    {
        this.setState(
            {

                [event.target.name]: event.target.value
            })
    }



    render()
    {
        return(
            <div>
                <h1>`${this.state.caseTitle}`</h1>
                <br />

                //INSERT INTERACTIVE PLATFORM FOR PHOTOS HERE
                <div>
                    <h3>Name for Case (Optional):</h3>
                    <input type={"text"} row={"20"}/>
                </div>
            </div>
        );
    }
};
